========

Let's Get Lost is a penetrating Oscar-nominated documentary on the life of jazz
trumpeter Chet Baker (1929-1988). After a generous amount of screen time
devoted to Baker's American career, from his days with Charlie &quot;Bird&quot; Parker
and Gerry Mulligan to the formation of his own combo, the film dwells upon
Baker's lengthy tenure in Europe. Of particular interest are the clips culled
from Baker's appearances in Italian films of the 1960s. In-depth interviews
with Baker's friends and co-workers paint a portrait of a troubled genius,
whose drug addiction and womanizing gradually eroded his talent. Much of the
terminal footage is literally that, showing in harsh detail what Chet Baker
had become in his last year on earth

